mrmilu_metatags_import_export.export:
  path: '/admin/config/search/metatag/export'
  defaults:
    _form: '\Drupal\mrmilu_metatags_import_export\Form\MetatagsExportForm'
    _title: 'Metatags export'
  requirements:
    _permission: 'administer meta tags'
  options:
    _admin_route: TRUE
mrmilu_metatags_import_export.import:
  path: '/admin/config/search/metatag/import'
  defaults:
    _form: '\Drupal\mrmilu_metatags_import_export\Form\MetatagsImportForm'
    _title: 'Metatags import'
  requirements:
    _permission: 'administer meta tags'
  options:
    _admin_route: TRUE
mrmilu_metatags_import_export.settings:
  path: '/admin/config/search/metatag/export/config'
  defaults:
    _form: '\Drupal\mrmilu_metatags_import_export\Form\MetatagsImportExportConfigForm'
    _title: 'Configure metatags to import/export'
  requirements:
    _permission: 'administer meta tags'
